let LISTA_CONNETTORI = [];
let outObject = new Object();

function resetALLCOMPONENTSFLAG() {
    LISTA_CONNETTORI = [];
    for (let i = 0; i < COMPONENTS_FLAG.length; i++) {
        //SetGetFLAG(COMPONENTS_FLAG[i].name, 1, false);
        COMPONENTS_FLAG[i].active = false;
        COMPONENTS_FLAG[i].compliant = false;
        COMPONENTS_FLAG[i].counter = 0;
    }

}

function json2Table(json) {
    json = JSON.parse(json);
    let cols = Object.keys(json[0]);
    //Map over columns, make headers,join into string
    let headerRow = cols.map(col => `<th>${col}</th>`).join("");
    //map over array of json objs, for each row(obj) map over column values,
    //and return a td with the value of that object for its column
    //take that array of tds and join them
    //then return a row of the tds
    //finally join all the rows together
    let rows = json.map(row => {
        let tds = cols.map(col => `<td>${row[col]}</td>`).join("");
        return `<tr>${tds}</tr>`;
    }
    ).join("");

    //build the table
    const table = `
	<table style="width:100%">
		<thead>
			<tr>${headerRow}</tr>
		<thead>
		<tbody>
			${rows}
		<tbody>
	<table>`;
    return table;
}

function prettifyCOMPONENTS() {
    return json2Table(JSON.stringify(COMPONENTS_FLAG));
}

function SetGetFLAG(name, type, new_value=null) {
    let found = false;
    let valore = false;
    let contatore = 0;
    let pallinatura = '';
    let funzione = null;
    let smeup = '';
    let lunghezza = 0;
    let opt = '';

    for (let i = 0; i < COMPONENTS_FLAG.length; i++) {
        if (COMPONENTS_FLAG[i].name == name) {
            found = true;
            pallinatura = COMPONENTS_FLAG[i].pallinatura;
            funzione = COMPONENTS_FLAG[i].funzione;
            smeup = COMPONENTS_FLAG[i].smeup;
            opt = COMPONENTS_FLAG[i].opt;
            //get
            if (type == 0) {
                valore = COMPONENTS_FLAG[i].active;

                if (typeof (COMPONENTS_FLAG[i].lunghezza) !== 'undefined') {
                    lunghezza = COMPONENTS_FLAG[i].lunghezza;
                    //console.log(COMPONENTS_FLAG[i]);
                }
            }

            //set
            if (type == 1) {
                COMPONENTS_FLAG[i].active = (new_value !== null) ? new_value : false;
                valore = COMPONENTS_FLAG[i].active;
                if (valore == false)
                    COMPONENTS_FLAG[i].counter = 0;
                if (valore == true)
                    COMPONENTS_FLAG[i].counter++;

                //console.log(  COMPONENTS_FLAG[i]);
            }
            contatore = COMPONENTS_FLAG[i].counter;
        }
    }

    let info = new Object();
    info.found = found;
    info.valore = valore && found;
    info.counter = contatore;
    info.pallinatura = pallinatura;
    info.funzione = funzione;
    info.smeup = smeup;
    info.lunghezza = lunghezza;
    info.opt = opt;

    return info;
}

function SetCOMPLIANTFLAG(name) {
    let found = false;
    for (let i = 0; i < COMPONENTS_FLAG.length; i++) {
        if (COMPONENTS_FLAG[i].name == name) {
            found = true;
            COMPONENTS_FLAG[i].compliant = true;
        }
    }
}

