class INFO_CAVO {
    constructor(acronimo, tipo_con_in, posizione, parent, potenza_propria) {
        this.acronimo = acronimo
        this.tipo_con_in = tipo_con_in;
        this.posizione = posizione;
        this.parent = parent;
        this.potenza = potenza_propria;
        this.marker = false;
    }
}

function setMarker(acronimo) {
    for (let i = 0; i < LISTA_CONNETTORI.length; i++) {
        if (LISTA_CONNETTORI[i].acronimo == acronimo)
            LISTA_CONNETTORI[i].marker = true;
    }
}

function setPotenza(acronimo, potenza) {
    for (let i = 0; i < LISTA_CONNETTORI.length; i++) {
        if (LISTA_CONNETTORI[i].acronimo == acronimo)
            LISTA_CONNETTORI[i].potenza = potenza;
    }
}

function ElaborazioneLISTACONNETTORI(viewLabel) {
    let sDis = '';

    if (viewLabel == 'Yes') {
        let xVIEW_POWER_LABELS = viewLabel;

        for (let i = 0; i < LISTA_CONNETTORI.length; i++) {
            if (LISTA_CONNETTORI[i].marker == false) // guard solo i nodi non esaminati
            {

                LISTA_CONNETTORI[i].marker = true;
                let children = LISTA_CONNETTORI.filter(function(child) {
                    return child.parent == LISTA_CONNETTORI[i].acronimo;
                });
                for (let k = 0; k < children.length; k++) {
                    if (children[k].marker == false) {
                        setMarker(children[k].acronimo);
                        LISTA_CONNETTORI[i].potenza += DEEPSEARCH_LISTACONNETTORI(children[k].acronimo, children[k].potenza);
                    } else {//console.log('..ops: marked');
                    }
                }
            }
        }

        for (let i = 0; i < LISTA_CONNETTORI.length; i++) {
            sDis += PallinaPotenza(LISTA_CONNETTORI[i].posizione, {
                R: 15,
                angle: parseFloat(-45 + (i * 180))
            }, LISTA_CONNETTORI[i].potenza.toFixed(1));
        }

    }

    return sDis;
}

function DEEPSEARCH_LISTACONNETTORI(acronimo, potenza_propria) {
    let potenza = potenza_propria;
    //console.log('--- deep searching for: "'+acronimo+"'");
    let sub_children = LISTA_CONNETTORI.filter(function(child) {
        return child.parent == acronimo;
    });
    //console.log('<--- '+acronimo + ': '+potenza);

    for (let k = 0; k < sub_children.length; k++) {
        if (sub_children[k].marker == false) {
            setMarker(sub_children[k].acronimo);
            potenza += DEEPSEARCH_LISTACONNETTORI(sub_children[k].acronimo, sub_children[k].potenza);
        }
    }
    //console.log('---> '+acronimo + ': '+potenza);
    setPotenza(acronimo, potenza);
    return potenza;
}

function PallinaPotenza(posC, offset, etk) {
    let fontSize = 1.51;
    let lato = 1.51 * fontSize;
    let delta = {
        x: parseFloat(offset.R * Math.cos(offset.angle * Math.PI / 180)),
        y: parseFloat(offset.R * Math.sin(offset.angle * Math.PI / 180))
    };
    let pos = {
        x: parseFloat(posC.x + delta.x),
        y: parseFloat(posC.y + delta.y)
    };
    let sDis = '';
    sDis += '<g>';
    sDis += '<line x1="' + posC.x + '" y1="' + posC.y + '" x2="' + pos.x + '" y2="' + pos.y + '" style="fill:black;stroke:black;stroke-width:0.2;" />';
    //sDis += '<circle cx="'+pos.x+'" cy="'+pos.y+'" r="'+1.51*fontSize+'" style="fill:white;stroke:black;stroke-width:0.3;" />';
    sDis += '<rect x="' + parseFloat(pos.x - 1.5 * lato) + '" y="' + parseFloat(pos.y - lato / 2) + '" width="' + 3 * lato + '" height="' + lato + '" style="fill:orange;stroke:black;stroke-width:0.2;" />';
    sDis += '<text x="' + parseFloat(pos.x - 1 * fontSize) + '" y="' + pos.y + '"  alignment-baseline="middle" style="fill:black; stroke:none;font-size:' + fontSize + 'px;font-weight=bold;"> ' + etk + 'W </text>';
    //text-anchor="middle"
    sDis += '</g>';
    return sDis;
}
