function disegnaLineaBezier(startX, endX, settings) {
    let start = startX;
    let end = endX;
    //console.log(start);
    //console.log(end);
    let sDis = '';
    let kStart = {
        x: parseFloat(start.x + settings.start.d * Math.cos(settings.start.angle * Math.PI / 180)),
        y: parseFloat(start.y + settings.start.d * Math.sin(settings.start.angle * Math.PI / 180))
    };
    let kEnd = {
        x: parseFloat(end.x + settings.end.d * Math.cos(settings.end.angle * Math.PI / 180)),
        y: parseFloat(end.y + settings.end.d * Math.sin(settings.end.angle * Math.PI / 180))
    };
    sDis += '<path d="M ' + start.x + ' ' + start.y + ' C ' + kStart.x + ' ' + kStart.y + ', ' + kEnd.x + ' ' + kEnd.y + ', ' + end.x + ' ' + end.y + '" style="fill:none;stroke:black;stroke-width:0.51;" stroke-dasharray="1,1"/>';
    return sDis;
}

