let LED_CONFIGURATION = '';

function truncate(string, limit) {
    if (string.length > limit) {
        return string.substr(0, limit) + "."
    } else {
        return string
    }
}

function EseguiFunzione(f, p1, p2, obj, lunghezza=0) {
    return f(p1, p2, obj, lunghezza);
}

function DisegnaIconaComponenteUsato(label, dim_target, obj) {
    let sDis = '';
    if (SetGetFLAG(label, 0).valore) {
        //console.log('funzione: '+SetGetFLAG(label, 0).funzione);
        sDis += EseguiFunzione(SetGetFLAG(label, 0).funzione, dim_target, SetGetFLAG(label, 0), obj);
    }
    return sDis;
}

function setupCurrentScale(dimensioni, dim_target) {
    let scale = 1;

    if (dim_target.w == 0 && dim_target.h == 0) {
        scale = 1;
    } else {
        if (dim_target.w != 0 && dim_target.h == 0) {
            scale = (dimensioni.w != 0) ? parseFloat(dim_target.w / dimensioni.w) : 1;
        } else {
            if (dim_target.w == 0 && dim_target.h != 0) {
                scale = (dimensioni.h != 0) ? parseFloat(dim_target.h / dimensioni.h) : 1;
            } else {
                scale = (dimensioni.w != 0) ? parseFloat(dim_target.w / dimensioni.w) : 1;
            }
        }
    }

    let pos = {
        x: 0,
        y: 0
    };

    if (LAST_X_POSITION_ON_GRID + scale * dimensioni.w > 189) {
        LAST_X_POSITION_ON_GRID = FIRST_X_POSITION_ON_GRID;
        LAST_Y_POSITION_ON_GRID += parseFloat(scale * dimensioni.h);
        LAST_ROW_ON_GRID++;
        //pos.x = FIRST_X_POSITION_ON_GRID;
        //pos.y = LAST_Y_POSITION_ON_GRID;
    }
    /*
  else
  {
    pos.x = LAST_X_POSITION_ON_GRID;
    pos.y = LAST_Y_POSITION_ON_GRID;
  }
  */

    pos.x = LAST_X_POSITION_ON_GRID;
    pos.y = LAST_Y_POSITION_ON_GRID;
    LAST_X_POSITION_ON_GRID += parseFloat(scale * dimensioni.w);

    let info = new Object();
    info.scale = scale;
    info.pos = pos;
    return info;
}

