function CalcolaBarreLED(larghezza, type=1) {
    var lista_dimensioni = [82, 118, 46];

    var scarto_minimo = 10000;
    var somma = 0;
    var i = 0;
    var j = 0;
    var k = 0;
    var scarto = 0;
    var lumen_new = 84;
    var lumen = 0;
    var pl_BL_new = 7;
    var pl_BC_new = 5;
    var pl_BP_new = 3;

    var distanza_barre = 8;

    var passo_LED = 18;
    var delta_tolleranza_min = 2;
    //mm
    var delta_tolleranza_max = 16;
    //mm
    var dist_minima = passo_LED - delta_tolleranza_min;
    var dist_massima = passo_LED + delta_tolleranza_max;
    var scarto_min = 10;

    out = new Object();
    out.BC = i;
    // corta
    out.BL = j;
    // lunga
    out.BP = k;
    // piccola
    out.lumen = lumen;
    out.scarto = scarto;
    out.potenza = 0;

    let dist_barre;

    if (type == 0) // uso tutte le barre led da 3, da 5 e 7 pl (per click)
    {
        ////////////////////////////////////////////////////////////

        for (k = 0; k < 26; k++) {
            for (i = 0; i < 26; i++) {
                for (j = 0; j < 26; j++) {
                    /*
  for(k=15; k>0; k--)
  {
    for(i=15; i>0; i--)
      {
          for(j=15; j>0; j--)
          { */
                    dist_barre = 0;
                    if (i + j + k > 0) {
                        dist_barre = distanza_barre * (i + j + k - 1);
                    }

                    //somma = parseFloat(i*lista_dimensioni[0]+j*lista_dimensioni[1]+k*lista_dimensioni[2] + dist_barre);
                    somma = parseFloat(i * (lista_dimensioni[0] + 10) + j * (lista_dimensioni[1] + 10) + k * (lista_dimensioni[2] + 10));
                    scarto = parseFloat(larghezza - somma);
                    if (scarto < scarto_minimo && scarto >= scarto_min && (i > 0 || j > 0 || k > 0) && //((scarto/2+5)>dist_minima&&(scarto/2+5)<dist_massima)&&
                    ((scarto / 2 + 5) < dist_massima) && scarto >= 0 && somma >= 0) {
                        lumen = parseInt(lumen_new * pl_BC_new * i + lumen_new * pl_BL_new * j + lumen_new * pl_BP_new * k);
                        out.BC = i;
                        out.BL = j;
                        out.BP = k;
                        out.lumen = lumen;
                        out.scarto = scarto;
                        out.LED = parseInt(k * pl_BP_new + i * pl_BC_new + j * pl_BL_new);
                        scarto_minimo = scarto;
                    }
                }
            }
        }
        console.log('larghezza: ' + larghezza + ' ------ scarto: ' + scarto_minimo);
        /////////////////////////////////////////////////////////////
    }

    if (type == 1) // uso le barre led da 5 e 7 pl
    {
        ////////////////////////////////////////////////////////////
        for (i = 0; i < 25; i++) {
            for (j = 0; j < 25; j++) {
                somma = parseInt(i * (lista_dimensioni[0] + 10) + j * (lista_dimensioni[1] + 10));
                scarto = parseInt(larghezza - somma);
                if (scarto < scarto_minimo && scarto >= 0) {
                    lumen = parseInt(lumen_new * pl_BC_new * i + lumen_new * pl_BL_new * j);
                    out.BC = i;
                    out.BL = j;
                    out.lumen = lumen;
                    out.scarto = scarto;
                    out.LED = parseInt(i * pl_BC_new + j * pl_BL_new);
                    scarto_minimo = scarto;
                }
            }
        }
        /////////////////////////////////////////////////////////////
    }

    if (type == 4) // uso le barre led da 5 e da 7, ma saturo le lunghe a 2
    {
        ////////////////////////////////////////////////////////////
        for (i = 0; i < 25; i++) {
            for (j = 0; j < 2; j++) {
                somma = parseInt(i * (lista_dimensioni[0] + 10) + j * (lista_dimensioni[1] + 10));
                scarto = parseInt(larghezza - somma);
                if (scarto < scarto_minimo && scarto >= 0) {
                    lumen = parseInt(lumen_new * pl_BC_new * i + lumen_new * pl_BL_new * j);
                    out.BC = i;
                    out.BL = j;
                    out.lumen = lumen;
                    out.scarto = scarto;
                    out.LED = parseInt(i * pl_BC_new + j * pl_BL_new);
                    scarto_minimo = scarto;
                }
            }
        }
        /////////////////////////////////////////////////////////////
    }

    if (type == 2) // uso solo la barra corta
    {
        ////////////////////////////////////////////////////////////
        for (i = 0; i < 25; i++) {
            somma = parseInt(i * (lista_dimensioni[0] + 10));
            scarto = parseInt(larghezza - somma);
            if (scarto < scarto_minimo && scarto >= 0) {
                lumen = parseInt(lumen_new * pl_BC_new * i);
                out.BC = i;
                out.BL = 0;
                out.lumen = lumen;
                out.scarto = scarto;
                out.LED = parseInt(i * pl_BC_new);
                scarto_minimo = scarto;
            }
        }
        /////////////////////////////////////////////////////////////
    }

    if (type == 3) // uso solo la barra lunga
    {
        ////////////////////////////////////////////////////////////
        for (j = 0; j < 25; j++) {
            somma = parseInt(j * (lista_dimensioni[1] + 10));
            scarto = parseInt(larghezza - somma);
            if (scarto < scarto_minimo && scarto >= 0) {
                lumen = parseInt(lumen_new * pl_BL_new * j);
                out.BC = 0;
                out.BL = j;
                out.lumen = lumen;
                out.scarto = scarto;
                out.LED = parseInt(j * pl_BL_new);
                scarto_minimo = scarto;
            }
        }
    }

    if (type == 4) // uso le barre led da 3 e 5pl, ma con numero di pl definiti da 5 e 7
    {
        ////////////////////////////////////////////////////////////
        for (i = 0; i < 25; i++) {
            for (j = 0; j < 25; j++) {
                somma = parseInt(i * (lista_dimensioni[0] + 10) + j * (lista_dimensioni[1] + 10));
                scarto = parseInt(larghezza - somma);
                if (scarto < scarto_minimo && scarto >= 0) {
                    lumen = parseInt(lumen_new * pl_BC_new * i + lumen_new * pl_BL_new * j);
                    out.BC = i;
                    out.BL = j;
                    out.lumen = lumen;
                    out.scarto = scarto;
                    out.LED = parseInt(i * pl_BC_new + j * pl_BL_new);
                    scarto_minimo = scarto;
                }
            }
        }
        let pl = parseInt(out.BC * 5 + out.BL * 7);
        console.log('B5: ' + out.BC + ' || B7: ' + out.BL);
        console.log('servono ' + pl + ' punti luce');
        let n_barre_usate = 1000;

        for (i = 0; i < 25; i++) {
            for (j = 0; j < 25; j++) {
                if (parseFloat(i * 5 + j * 3) == pl) {
                    if (parseInt(i + j) < n_barre_usate) {
                        n_barre_usate = parseInt(i + j);
                        lumen = parseInt(lumen_new * pl_BC_new * i + lumen_new * pl_BL_new * j);
                        out.BL = 0;
                        out.BC = i;
                        out.BP = j;
                        out.lumen = lumen;
                        out.scarto = scarto;
                        out.LED = parseInt(i * pl_BC_new + j * pl_BP_new);
                    }
                }
            }
        }
        console.log('B3: ' + out.BP + ' || B5: ' + out.BC + ' || B7: ' + out.BL);

        /////////////////////////////////////////////////////////////
    }

    out.potenza = 10.8 * out.BL + 7.2 * out.BC + 4.8 * out.BP;

    return out;

}
